import React, {useState,useEffect} from 'react';
import axios from 'axios';

function Weather() {
    const [weather, setWeather] = useState([])
    useEffect(()=>{
        axios.get("https://api.openweathermap.org/data/2.5/weather?lat=44.34&lon=10.99&appid=f3021487cb7016ce52b29e4f3afe35b1")
        .then((res)=>{
          console.log(res.data);
          setWeather(res.data)
        })
      },[])

  return (
    <div className='body'>
    <div className="container my-5">
      <div className=".enter">
        {
          weather.map((val)=>{
            return (
              <div className="col my-3">
                <div className="card" style={{ width: "18rem" }}>
                  <img src={val.temp} className="card-img-top" alt="..." />
                  <div className="card-body">
                    <h5 className="card-title">{val.main.pressure}</h5>
                    <p className="card-text">
                      {val.main.humidity}
                    </p>
                    {/* <p className="card-text-1"><p><b>Date Created:</b></p>
                      {val.publishedAt}
                    </p>
                    <p className="card-url">
                      <a href={val.url}>Link</a>
                    </p> */}
                  </div>
                </div>
              </div>
            )
          })
        }
      </div>
    </div>
    </div>

  )
}

export default Weather
